import React from 'react';
import './Users.css'
export default function Users({ data }) {
    const receiverSave = (e) => {
        localStorage.setItem('receiver', e.target.id);
    }

    return (
        <>
            {
                <div key={data.key} className='user' id={data.username} onClick={(e) => receiverSave(e)} >
                    <p>{data.username}</p>
                </div>
            }
        </>
    )
}
